import React, {Component} from "react"
import './App.css';
import Container from 'react-bootstrap/Container';


class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: null
    };
  }

  componentDidMount() {
    fetch("https://api.example.com/items")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    return (
    <>
    <Container className="p-3">
      <Container className="p-5 mb-4 bg-light rounded-3">
      <h1 className="header text-center">Spacestagram</h1>
      </Container>
    </Container>
    </>

    )
}
}

export default App;
